import React, { Component } from "react";

class Heading extends Component {
  render() {
    return (
      <div
        style={{
          textAlign: "center",
          marginBottom: "6%",
          color: "rgb(255, 132, 0)"
        }}
      >
        <h1>TOP TRACKS IN {this.props.country.toUpperCase()}</h1>
      </div>
    );
  }
}

export default Heading;
